import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Nombre } from 'src/app/model/Nombre';
import { LoginService } from 'src/app/servicios/login.service';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit{


  public tipoNombre : Nombre[] 

  constructor(public loginService: LoginService, private route: ActivatedRoute){

  }

  ngOnInit(): void {
    this.loginService.getTipoNombre(this.route.snapshot.params["name"]).subscribe(
      data => {
        let tipoNombre = data;
        console.dir(tipoNombre);
        },
        error => { console.log(error); })
  }


  function getFirstName(fullName) {
    // Se verifica que el parámetro sea una cadena no vacía
    if (typeof fullName === "string" && fullName.length > 0) {
      // Se divide la cadena por los espacios y se obtiene el primer elemento del arreglo resultante
      let firstName = fullName.split(" ")[0];
      // Se devuelve el nombre
      return firstName;
    } else {
      // Se devuelve un mensaje de error si el parámetro no es válido
      return "Por favor, ingrese un nombre completo válido";
    }
  }


}
